apis.each do |key, value|
    key = key #api
    val = value
    ln_val = val.length
	all_apis.append(key)

	if ln_val > 1
        #puts val

		if ln_val > 2
			count_version_gt = count_version_gt + 1
		end		
		count_withversion = count_withversion + 1
		val.each_with_index do |each_path, index|
			len = ln_val-1
			if index < len
				path_prev = val[index]
				path_next = val[index+1]
				if path_prev.include? "openapi" or path_next.include? "openapi"
					count_openapi = count_openapi + 1
				else
					begin 
						diffs = Swagger::Diff::Diff.new(path_prev, path_next)
						comp = diffs.compatible?
						#puts diffs.changes['removed_endpoints']

						if comp == true
							count_true = count_true + 1
							api_true.append(key)
							api_true_files.append(path_prev)
							api_true_files.append(path_next)
						else
						    puts "false"

						    values = diffs.changes
						    #puts values
                            change1 = values[:removed_endpoints]
                            change2 = values[:removed_request_params]
                            change3 = values[:removed_response_attributes]

                            if change1.length or change2.length or change3.length
                                change_ep = values[:removed_endpoints]
                                change_req = values[:removed_request_params]
                                change_resp = values[:removed_response_attributes]

                                impacted_operations = []

                                change_ep.each do |key, value|
                                    impacted_operations.append(key)
                                end
                                change_req.each do |key, value|
                                    impacted_operations.append(key)
                                end
                                change_resp.each do |key, value|
                                    impacted_operations.append(key)
                                end
                                operations[path_prev] = impacted_operations.uniq
                            else
                                puts diffs.changes
                            end

							count_false = count_false + 1
							api_false.append(key)
							api_false_files.append(path_prev)
							api_false_files_prev.append(path_prev)
							api_false_files.append(path_next)
						end
					
					rescue 
						not_valid.append(path_prev)
						not_valid.append(path_next)
					end
				end
			end
		    
		end
		
	end
	
end


file = "result/RQ1/changes_in_prev.csv"
CSV.open( file, 'w' ) do |writer|
  operations.each do |key, value|
    writer << [key, value.length]
  end
end






api_true = api_true.uniq
api_false = api_false.uniq
api_true_files = api_true_files.uniq
api_false_files = api_false_files.uniq
api_false_files_prev = api_false_files_prev.uniq



